import { __decorate } from "tslib";
import { Component, ViewChild } from '@angular/core';
import { FormValidationMessages } from '../common.service';
let AdddatabaseComponent = class AdddatabaseComponent {
    constructor(router, httpProvider, toastr) {
        this.router = router;
        this.httpProvider = httpProvider;
        this.toastr = toastr;
        this.adddatabaseForm = new databaseForm();
        this.isSubmitted = false;
        this.formValidationMessages = FormValidationMessages;
    }
    ngOnInit() {
    }
    Adddatabase(isValid) {
        this.isSubmitted = true;
        if (isValid) {
            this.toastr.info('Creating database', '', { timeOut: 2500 });
            this.httpProvider.savedatabase(this.adddatabaseForm).subscribe(async (data) => {
                if (data != null && data.body != null) {
                    if (data != null && data.body != null) {
                        var resultData = data.body;
                        if (resultData != null && resultData.isSuccess) {
                            this.toastr.clear();
                            this.toastr.success(resultData.message, '', { timeOut: 2000 });
                            setTimeout(() => {
                                this.router.navigate(['/Home']);
                            }, 500);
                        }
                    }
                }
            }, async (error) => {
                this.toastr.error(error.message);
                setTimeout(() => {
                    this.router.navigate(['/Home']);
                }, 500);
            });
        }
    }
};
